package Extra;

import java.util.ArrayList;
import java.util.HashMap;
import java.util.List;
import java.util.Map;

// 916. Word Subsets
// Solved
// Medium
// Topics
// Companies
// You are given two string arrays words1 and words2.

// A string b is a subset of string a if every letter in b occurs in a including multiplicity.

// For example, "wrr" is a subset of "warrior" but is not a subset of "world".
// A string a from words1 is universal if for every string b in words2, b is a subset of a.

// Return an array of all the universal strings in words1. You may return the answer in any order.

// Example 1:

// Input: words1 = ["amazon","apple","facebook","google","leetcode"], words2 = ["e","o"]
// Output: ["facebook","google","leetcode"]
// Example 2:

// Input: words1 = ["amazon","apple","facebook","google","leetcode"], words2 = ["l","e"]
// Output: ["apple","google","leetcode"]

// Constraints:

// 1 <= words1.length, words2.length <= 104
// 1 <= words1[i].length, words2[i].length <= 10
// words1[i] and words2[i] consist only of lowercase English letters.
// All the strings of words1 are unique.
public class WordSubSets {
    public List<String> wordSubsets(String[] words1, String[] words2) {
        int limit = 0;
        Map<Character, Integer> map = new HashMap<>();
        for (int i = 0; i < words2.length; i++) {
            if (limit < words2[i].length()) {
                limit = words2[i].length();
            }
            Map<Character, Integer> subMap = new HashMap<>();

            for (int j = 0; j < words2[i].length(); j++) {
                subMap.put(words2[i].charAt(j), subMap.getOrDefault(words2[i].charAt(j), 0) + 1);
            }
            for (char key : subMap.keySet()) {
                map.put(key, Math.max(map.getOrDefault(key, 0), subMap.get(key)));
            }
        }

        List<String> list = new ArrayList<>();
        for (int i = 0; i < words1.length; i++) {
            if (words1[i].length() >= limit) {
                Map<Character, Integer> subMap = new HashMap<>();

                for (int j = 0; j < words1[i].length(); j++) {

                    subMap.put(words1[i].charAt(j), subMap.getOrDefault(words1[i].charAt(j), 0) + 1);
                }
                boolean check = true;

                for (char key : map.keySet()) {
                    if (!subMap.containsKey(key)) {
                        check = false;
                        break;
                    }
                    if (subMap.get(key) < map.get(key)) {
                        check = false;
                        break;
                    }
                }
                if (check) {
                    list.add(words1[i]);
                }
            }
        }
        return list;
    }
}
